import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <li>
    <div>{data.name}</div>
    <div>{data.desc}</div>
    <div>{data.price}</div>
  </li>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
